import time

def seq_search(number_list,item):
    length=len(number_list)
    for i in range(length):
        if number_list[i]==item:
            return i


def binary_search(the_list, item):
    the_list.sort()
    first=0
    last=len(the_list)-1
    found=False
    while first<=last and not found:
        mid=(first+last)//2
        if the_list[mid]==item:
            found=True
        else:
            if item < the_list[mid]:
                last=mid-1
            else:
                first=mid+1
    return found

